import React from "react";

const About = () => {
  return (
    <section id="about">
      <span className="aboutHeading">What I do</span>
      <div className="aboutContent">
        <span className="aboutDescription"></span>
        <img src="" alt="" className="northernDevsLogo" />
      </div>
    </section>
  );
};

export default About;
